import React, { useState, useEffect } from 'react';
import { InventoryItem } from '../../types';
import { inventoryItems } from '../../constants';
import Card from '../ui/Card';

interface Station2Props {
  onComplete: (item: InventoryItem) => void;
  onFail: () => void;
}

// Data for the choices, using placeholders as requested.
const choicesData = [
  {
    id: 1,
    text: 'Ein Echo der Vergangenheit',
    imgSrc: 'data:image/png;base64,', // Placeholder
    correct: false,
  },
  {
    id: 2,
    text: 'Ein Versprechen für die Zukunft',
    imgSrc: 'data:image/png;base64,', // Placeholder
    correct: true,
  },
  {
    id: 3,
    text: 'Ein strahlender Moment im Jetzt',
    imgSrc: 'data:image/png;base64,', // Placeholder
    correct: false,
  },
];

// Fisher-Yates shuffle algorithm
const shuffleArray = <T,>(array: T[]): T[] => {
    const newArray = [...array];
    for (let i = newArray.length - 1; i > 0; i--) {
        const j = Math.floor(Math.random() * (i + 1));
        [newArray[i], newArray[j]] = [newArray[j], newArray[i]];
    }
    return newArray;
};


const Station2: React.FC<Station2Props> = ({ onComplete, onFail }) => {
  // Shuffle the choices once on component mount
  const [shuffledChoices, setShuffledChoices] = useState(() => shuffleArray(choicesData));
  const [selected, setSelected] = useState<number | null>(null);
  const [isRevealed, setIsRevealed] = useState(false);

  const handleSelect = (choice: typeof choicesData[0]) => {
    if (isRevealed) return;

    setSelected(choice.id);
    setIsRevealed(true);

    setTimeout(() => {
      if (choice.correct) {
        onComplete(inventoryItems.CRYSTAL);
      } else {
        onFail();
      }
    }, 2000);
  };

  return (
    <Card className="animate-fade-in">
      <p className="text-lg text-stone-300 mb-6 leading-relaxed italic">
        Du blickst in einen Spiegel, doch er zeigt dir nicht nur dein Gesicht. Er zeigt dir mögliche Wege. Welches Spiegelbild wählst du?
      </p>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {shuffledChoices.map((choice) => (
          <div
            key={choice.id}
            onClick={() => handleSelect(choice)}
            className={`
              rounded-lg overflow-hidden border-2 transition-all duration-300 cursor-pointer group
              ${selected === choice.id
                ? choice.correct ? 'border-green-500/80 shadow-green-500/20 shadow-lg' : 'border-red-500/80 shadow-red-500/20 shadow-lg'
                : 'border-stone-700 hover:border-yellow-400/80'
              }
              ${isRevealed ? 'pointer-events-none opacity-60' : ''}
            `}
          >
            <div className="relative h-48 w-full">
              <img src={choice.imgSrc} alt={choice.text} className="w-full h-full object-cover transition-transform duration-300 group-hover:scale-105" />
               <div className="absolute inset-0 bg-gradient-to-t from-black/60 to-transparent"></div>
            </div>
            <div className="p-4 bg-stone-800/50">
              <p className="font-lato text-stone-200">{choice.text}</p>
            </div>
          </div>
        ))}
      </div>

       {isRevealed && selected !== null && (
        <p className={`mt-6 text-lg animate-pulse ${choicesData.find(c => c.id === selected)?.correct ? 'text-green-400' : 'text-red-400'}`}>
          {choicesData.find(c => c.id === selected)?.correct 
            ? "Du wählst den Blick nach vorn. Ein Splitter des Spiegels löst sich und legt sich in deine Hand." 
            : "Der Blick zurück hält dich gefangen. Der Spiegel zerbricht und die Welt verblasst..."
          }
        </p>
      )}

      <style>{`
        @keyframes fade-in {
          from { opacity: 0; transform: translateY(10px); }
          to { opacity: 1; transform: translateY(0); }
        }
        .animate-fade-in { animation: fade-in 0.7s ease-out forwards; }
      `}</style>
    </Card>
  );
};

export default Station2;
